import { HashRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';
import Upload from './pages/Upload';

const App = () => {
  return (
    <HashRouter>
        <Route path='/upload' component={<Upload/>}/>
        <Route path='/' component={<Home/>}/>
        <Route/>
    </HashRouter>
  );
}

export default App;
